import React from 'react';
import Navbar from './Components/Navbar';
import './App.css';
import FrontPage from './Components/FrontPage';
import SearchBox from './Components/SearchBox';
import PurposeForm from './Components/PurposeForm';

function App() {
  return (
    <div className="App">
      <Navbar />
      <SearchBox />
      <FrontPage />
      {/* <PurposeForm /> */}
    </div>
  );
}

export default App;
